import { useEffect, useState } from "react";
import axios from "axios";
import { API_BASE } from "../config";
import "../AppStyles.css";

function AdminDashboard() {
  const [payments, setPayments] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchPayments = async () => {
      try {
        const res = await axios.get(`${API_BASE}/api/admin/payments`, {
          headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
        });
        setPayments(res.data);
      } catch (err) {
        setError(err.response?.data?.msg || "Access denied or failed to load payments.");
      } finally {
        setLoading(false);
      }
    };
    fetchPayments();
  }, []);

  const verifyPayment = async (id) => {
    try {
      await axios.put(`${API_BASE}/api/admin/payments/${id}/verify`, {}, {
        headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
      });
      setPayments(payments.map(p => p._id === id ? { ...p, status: "Verified" } : p));
    } catch (err) {
      alert(err.response?.data?.msg || "Verification failed.");
    }
  };

  return (
    <div className="page-container light-theme">
      <div className="clean-card" style={{ width: "90%", maxWidth: "1000px" }}>
        <h2 className="dashboard-title">Admin Dashboard</h2>
        <p className="dashboard-subtitle">Review and verify customer international payments.</p>

        {loading && <p className="loading-text">Loading payments...</p>}
        {error && <p className="error-text">{error}</p>}

        {!loading && !error && payments.length === 0 && (
          <p className="empty-state">No payments to review.</p>
        )}

        {!loading && payments.length > 0 && (
          <div className="table-wrapper">
            <table className="modern-table">
              <thead>
                <tr>
                  <th>Customer</th>
                  <th>Amount</th>
                  <th>Currency</th>
                  <th>SWIFT Code</th>
                  <th>Status</th>
                  <th>Action</th>
                </tr>
              </thead>
              <tbody>
                {payments.map(p => (
                  <tr key={p._id}>
                    <td>{p.payeeAccount}</td>
                    <td>{p.amount}</td>
                    <td>{p.currency}</td>
                    <td>{p.swiftCode}</td>
                    <td>
                      <span
                        className={`status-badge ${
                          p.status === "Verified" ? "success" : "pending"
                        }`}
                      >
                        {p.status}
                      </span>
                    </td>
                    <td>
                      {p.status !== "Verified" && (
                        <button
                          onClick={() => verifyPayment(p._id)}
                          className="primary-button small"
                        >
                          Verify
                        </button>
                      )}
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        )}
      </div>
    </div>
  );
}

export default AdminDashboard;
